window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.0.1","implementation":{"version":"10.3.1","name":"cucumber-js"},"cpu":{"name":"arm64"},"os":{"name":"darwin","version":"23.6.0"},"runtime":{"name":"node.js","version":"20.11.1"}}},{"source":{"data":"Feature: Channel Listeners Support\n\n  Background: Desktop Agent API\n    Given schemas loaded\n    Given User Channels one, two and three\n    Given A Desktop Agent in \"api1\"\n    Given \"instrumentMessageOne\" is a \"broadcastEvent\" message on channel \"channel-name\" with context \"fdc3.instrument\"\n    Given \"countryMessageOne\" is a \"broadcastEvent\" message on channel \"channel-name\" with context \"fdc3.country\"\n    Given \"instrumentContext\" is a \"fdc3.instrument\" context\n\n  Scenario: Configuring two context listeners should mean they both pick up data\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api1}\" with \"getOrCreateChannel\" with parameter \"channel-name\"\n    And I refer to \"{result}\" as \"channel1\"\n    And I call \"{channel1}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And I call \"{channel1}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n      | AAPL      | fdc3.instrument | Apple |\n    Then messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | channel-name      | {null}              | getOrCreateChannelRequest |\n      | channel-name      | fdc3.instrument     | addContextListenerRequest |\n      | channel-name      | fdc3.instrument     | addContextListenerRequest |\n\n  Scenario: Unsubscribing a context listener prevents it collecting data.\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api1}\" with \"getOrCreateChannel\" with parameter \"channel-name\"\n    And I refer to \"{result}\" as \"channel1\"\n    And I call \"{channel1}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And I call \"{result}\" with \"unsubscribe\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is empty\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type                      |\n      | channel-name      | {null}              | getOrCreateChannelRequest         |\n      | channel-name      | fdc3.instrument     | addContextListenerRequest         |\n      | {null}            | {null}              | contextListenerUnsubscribeRequest |\n\n  Scenario: I can create a listener which listens for any context type\n        In this version we are using the deprecated no-args approach\n\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api1}\" with \"getOrCreateChannel\" with parameter \"channel-name\"\n    And I refer to \"{result}\" as \"channel1\"\n    And I call \"{channel1}\" with \"addContextListener\" with parameter \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    And messaging receives \"{countryMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | type            | name   |\n      | fdc3.instrument | Apple  |\n      | fdc3.country    | Sweden |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | channel-name      | {null}              | getOrCreateChannelRequest |\n      | channel-name      | {null}              | addContextListenerRequest |\n\n  Scenario: I can create a listener which listens for any context type\n        In this version we are using the non-deprecated 2 args approach\n\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api1}\" with \"getOrCreateChannel\" with parameter \"channel-name\"\n    And I refer to \"{result}\" as \"channel1\"\n    And I call \"{channel1}\" with \"addContextListener\" with parameters \"{null}\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    And messaging receives \"{countryMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | type            | name   |\n      | fdc3.instrument | Apple  |\n      | fdc3.country    | Sweden |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | channel-name      | {null}              | getOrCreateChannelRequest |\n      | channel-name      | {null}              | addContextListenerRequest |\n","uri":"test/features/app-channels.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Channel Listeners Support","description":"","children":[{"background":{"id":"bdb917b3-cf0e-4059-a099-48f468291eb9","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"7078fa30-fcf8-4b1a-946e-87a2af1b6bdb","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"06d48c24-390c-4073-b718-688bd729b1a7","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User Channels one, two and three"},{"id":"7e0918e8-9a1f-4060-8fbe-f50798d20ba5","location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"A Desktop Agent in \"api1\""},{"id":"493528fb-17bf-4bb1-ba75-c965536e18cb","location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"\"instrumentMessageOne\" is a \"broadcastEvent\" message on channel \"channel-name\" with context \"fdc3.instrument\""},{"id":"70a3eef1-bc19 d.context.type | payload.context.name | matches_type             |\n      | one               | {null}               | {null}               | joinUserChannelRequest   |\n      | {null}            | {null}               | {null}               | getCurrentChannelRequest |\n      | one               | fdc3.instrument      | Apple                | broadcastRequest         |\n","uri":"test/features/broadcast.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Broadcasting","description":"","children":[{"background":{"id":"3c01fa5c-b432-4a32-9cc7-246e76d92caa","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"30edf236-70fc-4fca-8cb9-6bdb6ce84134","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"00acb6d7-0409-4876-a33b-fcdff781159d","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User Channels one, two and three"},{"id":"f370840f-464d-40ca-9027-6e7ba8c0501a","location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"A Desktop Agent in \"api\""},{"id":"27ac2105-ea22-4e3a-bd84-4a05fdfbb3ac","location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"\"instrumentMessageOne\" is a \"broadcastEvent\" message on channel \"channel-name\" with context \"fdc3.instrument\""},{"id":"14e5cdf8-2ca8-4fc3-85dc-e5c175e01f14","location":{"line":8,"column":5},"keyword":"Given ","keywordType":"Context","text":"\"countryMessageOne\" is a \"broadcastEvent\" message on channel \"channel-name\" with context \"fdc3.country\""},{"id":"77267046-d1cc-4985-8522-1b442b49abeb","location":{"line":9,"column":5},"keyword":"Given ","keywordType":"Context","text":"\"instrumentContext\" is a \"fdc3.instrument\" context"}]}},{"scenario":{"id":"9ac911af-f15d-4213-b2e3-41ffdb020cad","ta ent \"Sell\" with context \"fdc3.instrument\" and result type \"fdc3.order\"\n    And app \"travelAgent/t1\" resolves intent \"Buy\" with context \"fdc3.currency\" and result type \"fdc3.order\"\n    And \"instrumentContext\" is a \"fdc3.instrument\" context\n    And \"crazyContext\" is a \"fdc3.unsupported\" context\n\n  Scenario: Find Intent can return the same intent with multiple apps\n    When I call \"{api}\" with \"findIntent\" with parameter \"Buy\"\n    Then \"{result.intent}\" is an object with the following contents\n      | name |\n      | Buy  |\n    And \"{result.apps}\" is an array of objects with the following contents\n      | appId       | instanceId |\n      | bank        | b1         |\n      | travelAgent | t1         |\n    And messaging will have posts\n      | payload.intent | matches_type      |\n      | Buy            | findIntentRequest |\n\n  Scenario: Find Intent can return an error when an intent doesn't match\n    When I call \"{api}\" with \"findIntent\" with parameter \"Bob\"\n    Then \"{result}\" is an error with message \"NoAppsFound\"\n    And messaging will have posts\n      | payload.intent | matches_type      |\n      | Bob            | findIntentRequest |\n\n  Scenario: Find Intent can filter by a context type\n    When I call \"{api}\" with \"findIntent\" with parameters \"Buy\" and \"{instrumentContext}\"\n    Then \"{result.intent}\" is an object with the following contents\n      | name |\n      | Buy  |\n    And \"{result.apps}\" is an array of objects with the following contents\n      | appId |\n      | bank  |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type      |\n      | Buy            | fdc3.instrument      | AAPL                      | findIntentRequest |\n\n  Scenario: Find Intent can filter by generic result type\n    When I call \"{api}\" with \"findIntent\" with parameters \"OrderFood\" and \"{empty}\" and \"channel<fdc3.chips>\"\n    Then \"{result.intent}\" is an object with the following contents\n      | name      |\n      | OrderFood |\n    And \"{result.apps}\" is an array of objects with the following contents\n      | appId    | instanceId |\n      | chipShop | c2         |\n    And messaging will have posts\n      | payload.intent | payload.resultType  | matches_type      |\n      | OrderFood      | channel<fdc3.chips> | findIntentRequest |\n\n  Scenario: Find Intents By Context\n    When I call \"{api}\" with \"findIntentsByContext\" with parameter \"{instrumentContext}\"\n    Then \"{result}\" is an array of objects with the following contents\n      | intent.name | apps[0].appId | apps.length |\n      | Buy         | bank          |           1 |\n      | Sell        | bank          |           1 |\n    And messaging will have posts\n      | payload.context.type | payload.context.id.ticker | matches_type                |\n      | fdc3.instrument      | AAPL                      | findIntentsByContextRequest |\n\n  Scenario: Find Intents By Context can return an error when an intent doesn't match\n    When I call \"{api}\" with \"findIntentsByContext\" with parameter \"{crazyContext}\"\n    Then \"{result}\" is an error with message \"NoAppsFound\"\n    And messaging will have posts\n      | payload.context.type | payload.context.bogus | matches_type                |\n      | fdc3.unsupported     | {true}                | findIntentsByContextRequest |\n","uri":"test/features/find-intents.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Basic Intents Support","description":"","children":[{"background":{"id":"b3249154-aabc-4b97-8d0b-687248afd42f","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"f23d35a7-309c-41d8-b658-5a5afc990540","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"C eceives \"{intentMessageOne}\"\n    Then messaging will have posts\n      | type                | payload.intentResult.context.type | payload.intentResolution.intent |\n      | raiseIntentResponse | {empty}                           | BuyStock                        |\n      | intentResultRequest | fdc3.returned-intent              | {empty}                         |\n\n  Scenario: Intent Listeners Can Return Results (Channel)\n    Given \"resultHandler\" returns a channel\n    When I call \"{api1}\" with \"addIntentListener\" with parameters \"BuyStock\" and \"{resultHandler}\"\n    And messaging receives \"{intentMessageOne}\"\n    Then messaging will have posts\n      | type                | payload.intentResult.channel.type | payload.intentResult.channel.id |\n      | intentResultRequest | private                           | some-channel-id                 |\n\n  Scenario: Intent Listeners Can Return A Void Result\n    Given \"resultHandler\" returns a void promise\n    When I call \"{api1}\" with \"addIntentListener\" with parameters \"BuyStock\" and \"{resultHandler}\"\n    And messaging receives \"{intentMessageOne}\"\n    Then messaging will have posts\n      | type                | payload.intentResult.channel | payload.intentResult.context |\n      | intentResultRequest | {empty}                      | {empty}                      |\n","uri":"test/features/intent-listener.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Intent Listeners","description":"","children":[{"background":{"id":"e79793e1-d58a-4920-b9a3-aa10647922b7","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"ef61d656-dc60-40d8-b388-30cf0f22ee8b","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"6b9ac643-6797-459e-90d1-e9219ea0f46d","location":{"lin  will timeout\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    Then \"{result}\" is an error with message \"IntentDeliveryFailed\"\n\n  Scenario: Raise Intent Fails With An Error\n    Given Raise Intent will throw a \"TargetAppUnavailable\" error\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    Then \"{result}\" is an error with message \"TargetAppUnavailable\"\n\n  Scenario: void is returned in the result\n    Given Raise Intent will return no result\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    And I call \"{result}\" with \"getResult\"\n    Then \"{result}\" is undefined\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n\n  Scenario: Raising An intent With The App Parameter\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\" and \"{c1}\"\n    Then \"{result}\" is an object with the following contents\n      | source.appId | source.instanceId | intent    |\n      | chipShop     | c1                | OrderFood |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | payload.app.appId | payload.app.instanceId | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | chipShop          | c1                     | raiseIntentRequest |\n\n  Scenario: Context Data is returned in the result\n    Given Raise Intent will return a context of \"{instrumentContext}\"\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    And I call \"{result}\" with \"getResult\"\n    Then \"{result}\" is an object with the following contents\n      | type            | name  |\n      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n\n  Scenario: App Channel is returned in the result\n    Given Raise Intent will return an app channel\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    And I call \"{result}\" with \"getResult\"\n    Then \"{result}\" is an object with the following contents\n      | type | id             |\n      | app  | result-channel |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n\n  Scenario: User Channel is returned in the result\n    Given Raise Intent will return a user channel\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    And I call \"{result}\" with \"getResult\"\n    Then \"{result}\" is an object with the following contents\n      | type | id             |\n      | user | result-channel |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n\n  Scenario: Private Channel is returned in the result\n    Given Raise Intent will return a private channel\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    And I call \"{result}\" with \"getResult\"\n    Then \"{result}\" is an object with the following contents\n      | type    | id             |\n      | private | result-channel |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n","uri":"test/features/intent-results.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Intents Can Return Different Results","description":"","children":[{"background":{"id":"40c67b89-6958-484d-b681-4f801fc2d51b","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"396052a0-d9ea-4058-b6d4-5b4a42a7974d","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"31854923-7d58-43a6-a3b7-e5b392a36a74","location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"A Desktop Agent in \"api\""},{"id":"3b8f0c28-dc9c-4f8f-940c-ee767a722b65","location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"app \"chipShop/c1\" resolves intent \"OrderFood\""},{"id":"66e81fbd-d0b3-4e47-8120-117337010d1e","location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"\"instrumentContext\" is a \"fdc3.instrument\" context"}]}},{"scenario":{"id":"01d5863d-8a5f-461f-b72a-76753ef57737","tags":[],"location":{"line":9,"column":3},"keyword":"Scenario","name":"Raise Intent Will Timeout","description":"","steps":[{"id":"5a488e50-c5fe-4cbe-a23d-d9375c35060d","location":{"line":10,"column":5},"keyword":"Given ","keywordType":"Context","text":"Raise Intent will timeout"},{"id":"941cf7f1-d6b7-4ddd-b0b3-6a6f8937b222","location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text":"I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\""},{"id":"0176f564-cf2a-49fb-95b6-414f4105cc04","location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outco "{privateChannel.id}\" with context \"fdc3.instrument\"\n\n  Scenario: Adding and then unsubscribing an \"onAddContextListener\" listener will send a notification of each event to the agent\n    Given \"typesHandler\" pipes types to \"types\"\n    When I call \"{privateChannel}\" with \"onAddContextListener\" with parameter \"{typesHandler}\"\n    And I refer to \"{result}\" as \"theListener\"\n    And we wait for a period of \"100\" ms\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type                                  |\n      | privateChannelAddEventListenerRequest         | onAddContextListener | {privateChannel.id}      | {null}               | privateChannelAddEventListenerRequest         |\n      | privateChannelUnsubscribeEventListenerRequest | {null}               | {null}                   | {theListener.id}     | privateChannelUnsubscribeEventListenerRequest |\n\n  Scenario: Adding an \"onAddContextListener\" on a given Private Channel to receive a notification\n    Given \"onAddContextListenerMessage\" is a \"privateChannelOnAddContextListenerEvent\" message on channel \"{privateChannel.id}\" with contextType as \"fdc3.instrument\"\n    And \"typesHandler\" pipes types to \"types\"\n    When I call \"{privateChannel}\" with \"onAddContextListener\" with parameter \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And messaging receives \"{onAddContextListenerMessage}\"\n    Then \"{types}\" is an array of strings with the following values\n      | value           |\n      | fdc3.instrument |\n\n  Scenario: Adding and then unsubscribing an \"onUnsubscribe\" listener will send a notification of each event to the agent\n    Given \"typesHandler\" pipes types to \"types\"\n    When I call \"{privateChannel}\" with \"onUnsubscribe\" with parameter \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And I refer to \"{result}\" as \"theListener\"\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type                                  |\n      | privateChannelAddEventListenerRequest         | onUnsubscribe        | {privateChannel.id}      | {null}               | privateChannelAddEventListenerRequest         |\n      | privateChannelUnsubscribeEventListenerRequest | {null}               | {null}                   | {theListener.id}     | privateChannelUnsubscribeEventListenerRequest |\n\n  Scenario: Adding an \"onUnsubscribe\" on a given Private Channel to receive a notification\n    Given \"onUnsubscribeListenerMessage\" is a \"privateChannelOnUnsubscribeEvent\" message on channel \"{privateChannel.id}\" with contextType as \"fdc3.instrument\"\n    And \"typesHandler\" pipes types to \"types\"\n    When I call \"{privateChannel}\" with \"onUnsubscribe\" with parameter \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And messaging receives \"{onUnsubscribeListenerMessage}\"\n    Then \"{types}\" is an array of strings with the following values\n      | value           |\n      | fdc3.instrument |\n\n  Scenario: Adding and then unsubscribing an \"onDisconnect\" listener will send a notification of each event to the agent\n    Given \"voidHandler\" is a invocation counter into \"count\"\n    When I call \"{privateChannel}\" with \"onDisconnect\" with parameter \"{voidHandler}\"\n    And I refer to \"{result}\" as \"theListener\"\n    And we wait for a period of \"100\" ms\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type ontexts\"\n    When I call \"{privateChannel}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n\n  Scenario: Adding and then unsubscribing an \"onAddContextListener\" listener will send a notification of each event to the agent\n    Given \"typesHandler\" pipes events to \"types\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"addContextListener\" and \"{typesHandler}\"\n    And I refer to \"{result}\" as \"theListener\"\n    And we wait for a period of \"100\" ms\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type                                  |\n      | privateChannelAddEventListenerRequest         | onAddContextListener | {privateChannel.id}      | {null}               | privateChannelAddEventListenerRequest         |\n      | privateChannelUnsubscribeEventListenerRequest | {null}               | {null}                   | {theListener.id}     | privateChannelUnsubscribeEventListenerRequest |\n\n  Scenario: Adding an \"onAddContextListener\" on a given Private Channel to receive a notification\n    Given \"onAddContextListenerMessage\" is a \"privateChannelOnAddContextListenerEvent\" message on channel \"{privateChannel.id}\" with contextType as \"fdc3.instrument\"\n    And \"typesHandler\" pipes events to \"types\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"addContextListener\" and \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And messaging receives \"{onAddContextListenerMessage}\"\n    Then \"{types}\" is an array of strings with the following values\n      | value           |\n      | fdc3.instrument |\n\n  Scenario: Adding and then unsubscribing an \"onUnsubscribe\" listener will send a notification of each event to the agent\n    Given \"typesHandler\" pipes events to \"types\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"unsubscribe\" and \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And I refer to \"{result}\" as \"theListener\"\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type                                  |\n      | privateChannelAddEventListenerRequest         | onUnsubscribe        | {privateChannel.id}      | {null}               | privateChannelAddEventListenerRequest         |\n      | privateChannelUnsubscribeEventListenerRequest | {null}               | {null}                   | {theListener.id}     | privateChannelUnsubscribeEventListenerRequest |\n\n  Scenario: Adding an \"onUnsubscribe\" on a given Private Channel to receive a notification\n    Given \"onUnsubscribeListenerMessage\" is a \"privateChannelOnUnsubscribeEvent\" message on channel \"{privateChannel.id}\" with contextType as \"fdc3.instrument\"\n    And \"typesHandler\" pipes events to \"types\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"unsubscribe\" and \"{typesHandler}\"\n    And we wait for a period of \"100\" ms\n    And messaging receives \"{onUnsubscribeListenerMessage}\"\n    Then \"{types}\" is an array of strings with the following values\n      | value           |\n      | fdc3.instrument |\n\n  Scenario: Adding and then unsubscribing an \"onDisconnect\" listener will send a notification of each event to the agent\n    Given \"voidHandler\" is a invocation counter into \"count\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"disconnect\" and \"{voidHandler}\"\n    And I refer to \"{result}\" as \"theListener\"\n    And we wait for a period of \"100\" ms\n    And I call \"{theListener}\" with \"unsubscribe\"\n    Then messaging will have posts\n      | type                                          | payload.listenerType | payload.privateChannelId | payload.listenerUUID | matches_type                                  |\n      | privateChannelAddEventListenerRequest         | onDisconnect         | {privateChannel.id}      | {null}               | privateChannelAddEventListenerRequest         |\n      | privateChannelUnsubscribeEventListenerRequest | {null}               | {null}                   | {theListener.id}     | privateChannelUnsubscribeEventListenerRequest |\n\n  Scenario: Adding an \"onDisconnect\" on a given Private Channel to receive a notification\n    Given \"onDisconnectListenerMessage\" is a \"privateChannelOnDisconnectEvent\" message on channel \"{privateChannel.id}\"\n    And \"voidHandler\" is a invocation counter into \"count\"\n    When I call \"{privateChannel}\" with \"addEventListener\" with parameters \"disconnect\" and \"{voidHandler}\"\n    And we wait for a period of \"100\" ms\n    And messaging receives \"{onDisconnectListenerMessage}\"\n    Then \"{count}\" is \"1\"\n\n  Scenario: I can broadcast context on a private channel\n    Given \"instrumentContext\" is a \"fdc3.instrument\" context\n    When I call \"{privateChannel}\" with \"broadcast\" with parameter \"{instrumentContext}\"\n    Then messaging will have posts\n      | type             | payload.channelId   | payload.context.type | payload.context.name | matches_type     |\n      | broadcastRequest | {privateChannel.id} | fdc3.instrument      | Apple                | broadcastRequest |\n\n  Scenario: I disconnect from a private channel\n    And I call \"{privateChannel}\" with \"disconnect\"\n    And messaging will have posts\n      | payload.channelId   | matches_type                    |\n      | {null}              | createPrivateChannelRequest     |\n      | {privateChannel.id} | privateChannelDisconnectRequest |\n","uri":"test/features/private-channels.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Basic Private Channels Support","description":"","children":[{"background":{"id":"178b1a0a-d925-4f3d-9a62-21f5771f440a","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"3fbacfa1-be71-44a6-8490-ebf8b01ecab4","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"7051eb3d-e292-4236-8686-dcd44d8327fb","location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"User Channels one, two and three"},{"id":"8341839e-19cd-457c-93ce-1b2f6f45cfe5","location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"A Desktop Agent in \"api\""},{"id":"b9e0acee-dee0-4e38-9995-de1a64070e7c","location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"I call \"{api}\" with \"createPrivateChannel\""},{"id":"313bfe71-9f1d-497b-a967-bca2826c2a01","location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"I refer to \"{result}\" as \"privateChannel\""},{"id":"0b0cc3e6-193a-4583-95d7-f53e8d1a59c9","location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"\"instrumentMessageOne\" is a \"broadcastEvent\" message on channel \"{privateChannel.id}\" with context \"fdc3.instrument\""}]}},{"scenario":{"id":"df63a1fd-2286-4756-9f08-6f61feb2fdc4","tags":[],"location":{"line":11,"column":3},"keyword":"Scenario","name":"Adding and then unsubscribing a context listener will send a notification of each event to the agent","description":"","steps":[{"id":"1b2246e4-eead-4355-b871-1c4b9a68 ll}"},{"value":"createPrivateChannelRequest"}]},{"cells":[{"value":"{privateChannel.id}"},{"value":"privateChannelDisconnectRequest"}]}]}},"astNodeIds":["eca9e3a8-ff9e-4d1b-8fcc-f34983d0eb54"]}]}},{"source":{"data":"Feature: Basic Intents Support\n\n  Background: Desktop Agent API\n    Given A Desktop Agent in \"api\"\n    And schemas loaded\n    And app \"chipShop/c1\" resolves intent \"OrderFood\" with result type \"void\"\n    And app \"chipShop/c2\" resolves intent \"OrderFood\" with result type \"channel<fdc3.chips>\"\n    And app \"bank/b1\" resolves intent \"Buy\" with context \"fdc3.instrument\" and result type \"fdc3.order\"\n    And app \"bank/b1\" resolves intent \"Sell\" with context \"fdc3.instrument\" and result type \"fdc3.order\"\n    And app \"travelAgent/t1\" resolves intent \"BookFlight\" with context \"fdc3.country\" and result type \"fdc3.order\"\n    And app \"notused/n1\" resolves intent \"Buy\" with context \"fdc3.cancel-me\" and result type \"fdc3.order\"\n    And app \"notused/n2\" resolves intent \"Buy\" with context \"fdc3.cancel-me\" and result type \"fdc3.order\"\n    And \"instrumentContext\" is a \"fdc3.instrument\" context\n    And \"countryContext\" is a \"fdc3.country\" context\n    And \"cancelContext\" is a \"fdc3.cancel-me\" context\n\n  Scenario: Raising an intent and invoking the intent resolver when it's not clear which intent is required\n            The intent resolver will just take the first matching application\n            that would resolve the intent.\n\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{instrumentContext}\"\n    Then \"{result}\" is an object with the following contents\n      | source.appId | source.instanceId |\n      | chipShop     | c1                |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | payload.app.instanceId | matches_type       |\n      | OrderFood      | fdc3.instrument      | AAPL                      | {null}                 | raiseIntentRequest |\n      | OrderFood      | fdc3.instrument      | AAPL                      | c1                     | raiseIntentRequest |\n\n  Scenario: Raising an intent and invoking the intent resolver, but the user cancels it.\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"OrderFood\" and \"{cancelContext}\"\n    Then \"{result}\" is an error with message \"UserCancelledResolution\"\n    And messaging will have posts\n      | payload.intent | payload.context.type | matches_type       |\n      | OrderFood      | fdc3.cancel-me       | raiseIntentRequest |\n\n  Scenario: Raising Intent exactly right, so the resolver isn't required\n    When I call \"{api}\" with \"raiseIntent\" with parameters \"Buy\" and \"{instrumentContext}\"\n    Then \"{result}\" is an object with the following contents\n      | source.appId | source.instanceId |\n      | bank         | b1                |\n    And messaging will have posts\n      | payload.intent | payload.context.type | payload.context.id.ticker | matches_type       |\n      | Buy            | fdc3.instrument      | AAPL                      | raiseIntentRequest |\n\n  Scenario: Raising Intent By Context and invoking the intent resolver when it's not clear which intent is required\n            The intent resolver will just take the first matching application\n            that would resolve an intent.\n\n    When I call \"{api}\" with \"raiseIntentForContext\" with parameter \"{instrumentContext}\"\n    Then \"{result}\" is an object with the following contents\n      | source.appId | source.instanceId |\n      | chipShop     | c1                |\n    And messaging will have posts\n      | payload.context.type | payload.context.id.ticker | payload.app.instanceId | matches_type                 |\n      | fdc3.instrument      | AAPL                      | {null}                 | raiseIntentForContextRequest |\n      | fdc3.instrument      | AAPL                      | c1                     | raiseIntentRequest           |\n\n  Scenario: Raising Intent By Context exactly right, so the resolver isn't required\n    When I call \"{api}\" with \"raiseIntentForContext\" with parameters \"{countryContext}\" and \"{t1}\"\n    Then \"{result}\" is an object with the following contents\n      | source.appId | source.instanceId |\n      | travelAgent  | t1                |\n    And messaging will have posts\n      | payload.context.type | payload.context.name | payload.app.appId | payload.app.instanceId | matches_type                 |\n      | fdc3.country         | Sweden               | travelAgent       | t1                     | raiseIntentForContextRequest |\n\n  Scenario: Raising an intent and invoking the intent resolver, but the user cancels it.\n    When I call \"{api}\" with \"raiseIntentForContext\" with parameter \"{cancelContext}\"\n    Then \"{result}\" is an error with message \"UserCancelledResolution\"\n    And messaging will have posts\n      | payload.context.type | matches_type                 |\n      | fdc3.cancel-me       | raiseIntentForContextRequest |\n","uri":"test/features/raise-intents.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Basic Intents Support","description":"","children":[{"background":{"id":"b6601e03-e22f-4d11-b023-bdc8d5f54ac9","location":{"line":3,"column":3},"keyword":"Background","name":"Desktop Agent API","description":"","steps":[{"id":"bdc18946-84e6-4bcf-a7da-9547ed2a7dbc","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"A Desktop Agent in \"api\""},{"id":"dd219113-b335-47b3-9466-8345cff842f6","location":{"line":5,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"schemas loaded"},{"id":"e62c14c8-1ac3-4c25-ad3e-758424f7e24f","location":{"line":6,"column":5},"keyword":"And ","keywordType":"Conjunction","text" tches_type"}]},{"cells":[{"value":"fdc3.cancel-me"},{"value":"raiseIntentForContextRequest"}]}]}},"astNodeIds":["6bbdbb41-7b96-405a-bea0-f55eac2a3fe1"]}]}},{"source":{"data":"Feature: Updating User Channel State\n\n  Background:\n    Given schemas loaded\n    Given User Channels one, two and three\n    Given \"instrumentContext\" is a \"fdc3.instrument\" context\n    And \"crazyContext\" is a \"fdc3.unsupported\" context\n    And channel \"one\" has context \"{instrumentContext}\"\n    And channel \"two\" has context \"{crazyContext}\"\n    And A Desktop Agent in \"api\"\n\n  Scenario: Joining A User Channel Receives Correct Context on Listener\n    Given \"resultHandler\" pipes context to \"contexts\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | type            | name  |\n      | fdc3.instrument | Apple |\n    And I call \"{api}\" with \"getCurrentChannel\"\n    And I call \"{result}\" with \"getCurrentContext\" with parameter \"fdc3.instrument\"\n    Then \"{result}\" is an object with the following contents\n      | type            | name  |\n      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | payload.listenerUUID | matches_type             |\n      | one               | {null}              | {null}               | joinUserChannelRequest   |\n      | one               | fdc3.instrument     | {null}               | getCurrentContextRequest |\n      | {null}            | {null}              | {null}               | getCurrentChannelRequest |\n      | one               | fdc3.instrument     | {null}               | getCurrentContextRequest |\n\n  Scenario: Changing User Channel Doesn't Receive Incoorrect Context on Listener\n    Given \"resultHandler\" pipes context to \"contexts\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"two\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | type | name |\n    And I call \"{api}\" with \"getCurrentChannel\"\n    And I call \"{result}\" with \"getCurrentContext\" with parameter \"fdc3.instrument\"\n    Then \"{result}\" is null\n\n  Scenario: disconnection\n    When I call \"{api}\" with \"disconnect\"\n    Then \"{result}\" is undefined\n","uri":"test/features/user-channel-sync.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Updating User Channel State","description":"","children":[{"background":{"id":"1dad0661-40be-4f03-a63d-7885dc2db0c3","location":{"line":3,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"9f8e089e-c6c4-4bfd-90d2-d6397999a213","location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"schemas loaded"},{"id":"27bbbda0-8e47-4651-b9a5-62eba86b1b2a","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"User Channels one, two and three"},{"id":"b313beda-4e97-4130-bdf4-abdf053868ad","location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"\"instrumentContext\" is a \"fdc3.instrument\" context"},{"id":"c5188adf-4db0-4966-8593-a639fccb0ba4","location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"\"crazyContext\" is a \"fdc3.unsupported\" context"},{"id":"0282a80e-6d04-4433-bb0d-c32751724358","location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"channel \"one\" has context \"{instrumentContext}\""},{"id":"c65ce36e-5658-4c3d-b2cd-e54420a9d66c","location":{"line":9,"column":5},"keyword":"And ","keywordType":"Conjunction","text lChangedEvent message on channel \"two\"\n\n  Scenario: List User Channels\n        There should be a selection of user channels to choose from\n\n    When I call \"{api}\" with \"getUserChannels\"\n    Then \"{result}\" is an array of objects with the following contents\n      | id    | type | displayMetadata.color | displayMetadata.glyph | displayMetadata.name |\n      | one   | user | red                   | triangle              | The one channel      |\n      | two   | user | red                   | triangle              | The two channel      |\n      | three | user | red                   | triangle              | The three channel    |\n    And messaging will have posts\n      | meta.source.appId | meta.source.instanceId | matches_type           |\n      | cucumber-app      | cucumber-instance      | getUserChannelsRequest |\n\n  Scenario: List User Channels via Deprecated API call\n        There should be a selection of user channels to choose from\n\n    When I call \"{api}\" with \"getSystemChannels\"\n    Then \"{result}\" is an array of objects with the following contents\n      | id    | type | displayMetadata.color | displayMetadata.glyph | displayMetadata.name |\n      | one   | user | red                   | triangle              | The one channel      |\n      | two   | user | red                   | triangle              | The two channel      |\n      | three | user | red                   | triangle              | The three channel    |\n    And messaging will have posts\n      | meta.source.appId | meta.source.instanceId | matches_type           |\n      | cucumber-app      | cucumber-instance      | getUserChannelsRequest |\n\n  Scenario: Initial User Channel\n        At startup, the user channel shouldn't be set\n\n    When I call \"{api}\" with \"getCurrentChannel\"\n    Then \"{result}\" is null\n    And messaging will have posts\n      | meta.source.appId | meta.source.instanceId | matches_type             |\n      | cucumber-app      | cucumber-instance      | getCurrentChannelRequest |\n\n  Scenario: Changing Channel\n        You should be able to join a channel knowing it's ID.\n\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    When I call \"{api}\" with \"getCurrentChannel\"\n    Then \"{result}\" is an object with the following contents\n      | id  | type | displayMetadata.color |\n      | one | user | red                   |\n    And messaging will have posts\n      | payload.channelId | matches_type             |\n      | one               | joinUserChannelRequest   |\n      | {null}            | getCurrentChannelRequest |\n\n  Scenario: Changing Channel via Deprecated API\n        You should be able to join a channel knowing it's ID.\n\n    When I call \"{api}\" with \"joinChannel\" with parameter \"one\"\n    When I call \"{api}\" with \"getCurrentChannel\"\n    Then \"{result}\" is an object with the following contents\n      | id  | type | displayMetadata.color |\n      | one | user | red                   |\n    And messaging will have posts\n      | payload.channelId | matches_type             |\n      | one               | joinUserChannelRequest   |\n      | {null}            | getCurrentChannelRequest |\n\n  Scenario: Adding a Typed Listener on a given User Channel\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | one               | {null}              | joinUserChannelRequest    |\n      | {null}            | {null}              | getCurrentChannelRequest  |\n      | one               | fdc3.instrument     | addContextListenerRequest |\n\n  Scenario: Adding an Un-Typed Listener on a given User Channel\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"{empty}\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | one               | {null}              | joinUserChannelRequest    |\n      | {null}            | {null}              | getCurrentChannelRequest  |\n      | one               | {null}              | addContextListenerRequest |\n\n  Scenario: Adding an Un-Typed Listener on a given User Channel (deprecated API)\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"addContextListener\" with parameter \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | one               | {null}              | joinUserChannelRequest    |\n      | {null}            | {null}              | getCurrentChannelRequest  |\n      | one               | {null}              | addContextListenerRequest |\n\n  Scenario: If you haven't joined a channel, your listener receives nothing\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is empty\n    And messaging will have posts\n      | payload.channelId | payload.contextType | matches_type              |\n      | {null}            | {null}              | getCurrentChannelRequest  |\n      | {null}            | fdc3.instrument     | addContextListenerRequest |\n\n  Scenario: After unsubscribing, my listener shouldn't receive any more messages\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And I refer to \"{result}\" as \"theListener\"\n    And messaging receives \"{instrumentMessageOne}\"\n    And I call \"{theListener}\" with \"unsubscribe\"\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.contextType | payload.listenerUUID | matches_type                      |\n      | one               | {null}              | {null}               | joinUserChannelRequest            |\n      | {null}            | {null}              | {null}               | getCurrentChannelRequest          |\n      | one               | fdc3.instrument     | {null}               | addContextListenerRequest         |\n      | {null}            | {null}              | {theListener.id}     | contextListenerUnsubscribeRequest |\n\n  Scenario: I should be able to leave a user channel, and not receive messages on it\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"addContextListener\" with parameters \"fdc3.instrument\" and \"{resultHandler}\"\n    And I call \"{api}\" with \"leaveCurrentChannel\"\n    Then messaging will have posts\n      | payload.channelId | payload.contextType | payload.listenerUUID | matches_type               |\n      | one               | {null}              | {null}               | joinUserChannelRequest     |\n      | {null}            | {null}              | {null}               | getCurrentChannelRequest   |\n      | one               | fdc3.instrument     | {null}               | addContextListenerRequest  |\n      | {null}            | {null}              | {null}               | leaveCurrentChannelRequest |\n    And messaging receives \"{instrumentMessageOne}\"\n    Then \"{contexts}\" is an array of objects with the following contents\n      | id.ticker | type | name |\n\n  Scenario: Joining a user channel that doesn't exist throws an error\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"nonexistent\"\n    Then \"{result}\" is an error with message \"NoChannelFound\"\n\n  Scenario: You can get the details of the last context type sent\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"getCurrentChannel\"\n    And I refer to \"{result}\" as \"theChannel\"\n    And I call \"{api}\" with \"broadcast\" with parameter \"{instrumentContext}\"\n    And I call \"{theChannel}\" with \"getCurrentContext\"\n    Then \"{result}\" is an object with the following contents\n      | id.ticker | type            | name  |\n      | AAPL      | fdc3.instrument | Apple |\n    And messaging will have posts\n      | payload.channelId | payload.context.type | payload.context.id.ticker | matches_type             |\n      | one               | {null}               | {null}                    | joinUserChannelRequest   |\n      | {null}            | {null}               | {null}                    | getCurrentChannelRequest |\n      | {null}            | {null}               | {null}                    | getCurrentChannelRequest |\n      | one               | fdc3.instrument      | AAPL                      | broadcastRequest         |\n      | one               | {null}               | {null}                    | getCurrentContextRequest |\n\n  Scenario: Asking for a piece of context (e.g. an email) when it's not been sent returns null\n    Given \"resultHandler\" pipes context to \"contexts\"\n    When I call \"{api}\" with \"joinUserChannel\" with parameter \"one\"\n    And I call \"{api}\" with \"getCurrentChannel\"\n    And I refer to \"{result}\" as \"theChannel\"\n    And messaging receives \"{instrumentMessageOne}\"\n    And I call \"{theChannel}\" with \"getCurrentContext\" with parameter \"fdc3.email\"\n    Then \"{result}\" is null\n\n  Scenario: User Channel Updated By Desktop Agent\n    When messaging receives \"{userChannelMessage2}\"\n    Then \"{channelId}\" is \"two\"\n\n  Scenario: Adding A User Channel Event Listener\n    Given \"typesHandler\" pipes events to \"types\"\n    When I call \"{api}\" with \"addEventListener\" with parameters \"userChannelChanged\" and \"{typesHandler}\"\n    And messaging receives \"{userChannelMessage2}\"\n    And messaging receives \"{userChannelMessage1}\"\n    Then \"{types}\" is an array of objects with the following contents\n      | newChannelId |\n      | two          |\n      | one          |\n\n  Scenario: Adding An Unknown Event Listener\n    Given \"typesHandler\" pipes events to \"types\"\n    When I call \"{api}\" with \"addEventListener\" with parameters \"unknownEventType\" and \"{typesHandler}\"\n    Then \"{result}\" is an error with message \"UnknownEventType\"\n","uri":"test/features/user-channels.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column
